import {FiMenu} from "react-icons/fi";
import {FaPlay, FaGithub, FaLinkedin} from "react-icons/fa";
import {ImYoutube2} from "react-icons/im";
import {TiArrowSortedDown} from "react-icons/ti";
import goblin from './img/goblin_.png';
import {useState} from "react";


function App() {
  const [isMenuBar, setIsMenuBar] = useState(true)

  const handleClick = () =>{
      console.log('isClicked!')
  }

  const menuToggle = () =>{
      setIsMenuBar(!isMenuBar)
      if(isMenuBar){
        let menu = document.querySelector('#menu-icon')
        let nav = document.querySelector('.navlist')
        menu.classList.toggle('bx-x')
        nav.classList.toggle('open')
      }
  }

  return (
    <div className="App">
      <header className="App-header">
        <a href={'/'} onClick={handleClick} className={'logo'} >COC-STATS</a>
        <ul className={'navlist'}>
            <li><a href={'/'} onClick={handleClick}>Home</a></li>
            <li><a href={'/'} onClick={handleClick}>About</a></li>
            <li><a href={'/'} onClick={handleClick}>Clans</a></li>
            <li><a href={'/'} onClick={handleClick}>Towns Hall</a></li>
            <li><a href={'/'} onClick={handleClick}>Troops</a></li>
            <li><a href={'/'} onClick={handleClick}>Contacts</a></li>
        </ul>

        <div id={'menu-icon'} className={'open'} onClick={menuToggle}><FiMenu/></div>
      </header>

      <section className={'hero'}>
          <div className={'hero-text'}>
              <h5>#2 Trending</h5>
              <h4>Lead Supercell</h4>
              <h1>GOBLINS</h1>
              <p>Join millions of players worldwide as you build your village, <br/>
                  raise a clan, and compete in epic Clan Wars!</p>
              <a href={'/'} onClick={handleClick}>Compare</a>
              <a href={'/'} onClick={handleClick} className={'ctaa'}><FaPlay id={'faPlay'}/> Watch Gameplay</a>
          </div>

          <div className={'hero-img'}>
              <img src={goblin} alt={'GoblinImg'}/>
          </div>
      </section>

      <div className={'icons'}>
          <a href={'/'}><FaGithub /></a>
          <a href={'/'}><FaLinkedin /></a>
          <a href={'/'}><ImYoutube2 /></a>
      </div>

      <div className={'scroll-down'}>
          <a href={'/'} id={'i'}><TiArrowSortedDown/></a>

      </div>

    </div>
  );
}

export default App;
